import React from 'react';

class Flights extends React.Component{
    render(){
        return (
            <div>
                <div id="flight-radio">
                    <div> 
                        <input type ="radio"/>
                        <span>Round-trip</span>
                    </div>
                    <div>
                        <input type ="radio"/>
                        <span>One-way</span>
                    </div>
                    <div>
                        <input type ="radio"/>
                        <span>Multi-destination</span>
                    </div>

                </div>
            </div>
        );
    }
}
export default Flights;
